    },
    {
      id: 2,
      title : "Jackets",
    },
    {
      id: 3,
      title : "Snaekers",
    },
    {
      id: 4,
      title : "Women",
    },
    {
      id: 5,
      title : "Men",
     },
   ]

  return (
  <div className="categories-container">
    {
      categories.map(({ title ,id}) => (

          <div keyclassName="category-container">
            <div className="category-body-container">
              <h2>{title}</h2>
              <p>Shop Now</p>
            </div>
          </div>

      ))
      }
      </div>
  );
}

export default App;
